		public void js(ulong dst) {
			Code op;
			if (PreferBranchShort) {
				if (Bitness == 64) {
					op = Code.Js_rel8_64;
				} else op = Bitness >= 32 ? Code.Js_rel8_32 : Code.Js_rel8_16;
			} else if (Bitness == 64) {
				op = Code.Js_rel32_64;
			} else op = Bitness >= 32 ? Code.Js_rel32_32 : Code.Js_rel16;
			AddInstruction(Instruction.CreateBranch(op, dst));
		}
